import React from 'react';
import App from './App';
import MovieList from './movies';

function NavBar() {
  return (
    <nav className="nav">
      <button className="btn btn-primary" onClick={App}>
        Home
      </button>
      <button className="btn btn-primary" onClick={MovieList}>
        Movies
      </button>
      <button ref="/podcasts">Podcasts</button>
    </nav>
  );
}

export default NavBar;
